DROP TABLE IF EXISTS `sales`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `sales` (
  `totalSaleAmount` double NOT NULL,
  `saleType` varchar(15) NOT NULL,
  `saleID` int NOT NULL,
  `employeeEmail` varchar(30) NOT NULL,
  `customerEmail` varchar(30) NOT NULL,
  `itemID` int NOT NULL,
  PRIMARY KEY (`saleID`),
  KEY `employeeEmail` (`employeeEmail`),
  KEY `customerEmail` (`customerEmail`),
  KEY `itemID` (`itemID`),
  CONSTRAINT `sales_ibfk_1` FOREIGN KEY (`employeeEmail`) REFERENCES `employee` (`email`),
  CONSTRAINT `sales_ibfk_2` FOREIGN KEY (`customerEmail`) REFERENCES `customer` (`email`),
  CONSTRAINT `sales_ibfk_3` FOREIGN KEY (`itemID`) REFERENCES `stock` (`itemID`),
  CONSTRAINT `sales_chk_1` CHECK ((`totalSaleAmount` > 0)),
  CONSTRAINT `sales_chk_2` CHECK ((`saleID` > 0)),
  CONSTRAINT `sales_chk_3` CHECK (regexp_like(`employeeEmail`,_utf8mb4'[@]')),
  CONSTRAINT `sales_chk_4` CHECK (regexp_like(`customerEmail`,_utf8mb4'[@]')),
  CONSTRAINT `sales_chk_5` CHECK ((`itemID` > 0))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

